import React, { useEffect } from 'react'
import data from './Data'
import Card from './Card'

const DataEffect = () => {
    useEffect(()=>{
        data.map((data)=>{
            return <Card val_={data}/>
        })
    },[data])
    return(
    <>
    {data.map((data)=>{
        return <Card val_={data}/>
    })}
    </>)
}

export default DataEffect
